//tooltip au survol de la place
function aper(obj,couleur,de,pl)
{
	obj.animate({fill: couleur, stroke: couleur}, 300);
	key="s" + obj.data('num');
	if (de[key]==undefined)
	{
		obj.attr({"title": ""});
		obj.data({"message":pl + " : " + "Cette place n'est pas attribu√©e"});
		if(Raphael.type=="SVG")
			{obj.setToolTipText(obj.data("message"));}
			else{obj.attr({"title": ""}).attr({"title":obj.data("message")})}
		obj.data({"drapeau":"non"});
	}
	else
	{
		obj.data({"drapeau":"oui","image":"/14/tribun/photos/" + de[key].id + ".jpg","lien": "/14/tribun/fiches_id/" + de[key].id + ".asp","nom":de[key].nom,"civ":de[key].civ,"groupe":de[key].groupe,"circo":de[key].circo});
		obj.attr({"title": ""});
		if(Raphael.type=="SVG")
			{obj.setToolTipText(de[key].civ + " " + de[key].nom + " (" + pl + ")");}
			else{obj.attr({"title": ""}).attr({"title": de[key].civ + " " + de[key].nom + " (" + pl + ")"})}
	}		
};

// animation de la photo
function anim(obj,set1,set2,set3,set4,paper)
{
	set1.animate({transform:"T" + 100 + ",0" + "T0," + 100 + "s0"},1000)
	set2.remove();
	set3.remove();
	set4.remove();
	if(Raphael.svg)
	{
		set4.push(paper.image(obj.data("image"),obj.getBBox().x,obj.getBBox().y,49,64));
		set3.push(paper.image("/commun/2011/images/theme/f.png",obj.getBBox().x-3,obj.getBBox().y,24,24).toFront());
		set3.push(paper.text((obj.getBBox().width/2)+obj.getBBox().x,(obj.getBBox().height/2)+obj.getBBox().y,obj.data("num"))).attr({"font-size":8,fill: "#fff"}).toFront();
	}
	else
	{
		set3.push(paper.text((obj.getBBox().width/2)+obj.getBBox().x,(obj.getBBox().height/2)+obj.getBBox().y,obj.data("num"))).attr({"font-size":8,fill: "#000"}).toFront();
		set4.push(paper.image(obj.data("image"),obj.getBBox().x,obj.getBBox().y,49,64));
	}

	trans="T" + (398 - set4.getBBox().x) + ",0" + "T0," + (366 - set4.getBBox().y) + "s2";
	obj.animate({fill: "#CBCBCB", stroke: "#ffffff"}, 300);
	var anim = Raphael.animation({transform:trans},1500,"backOut",function()
			{
				if(obj.data("groupe")=="")
				{
				set2.push(paper.text(425,500,obj.data("civ") + " " + obj.data("nom") + "\n" + obj.data("circo") + "\n" + "Non inscrit" + "\nCliquez sur la photo\npour acc√©der √† sa fiche")).attr({'font-size':12});
				}
				else
				{
				set2.push(paper.text(425,500,obj.data("civ") + " " + obj.data("nom") + "\n" + obj.data("circo") + "\n" + obj.data("groupe") + "\nCliquez sur la photo\npour acc√©der √† sa fiche")).attr({'font-size':12});
				}
				set2.push(paper.image("/commun/2011/images/theme/profile-picture-shadow.png",360,456,124,13));
				set1.remove().push(set4.pop());
			});
	set4.animate(anim.delay(100)).attr({"title":"Cliquez ici pour acc√©der √† sa fiche","href":obj.data("lien")});

};

//initialisation du select des d√©put√©s
function recherche(de)
{
	var options='<option value="">Choisissez un d√©put√©</option>';
	$.each(de, function(key) {options+='<option value="' + key + '">' + de[key].civ + ' ' + de[key].nom + '</option>'});
	$("#rec").append(options);
	$(".chzn-select").chosen({no_results_text: "Aucun r√©sultat"});
}